import React , {useState} from 'react'
import { Box } from '@mui/material'
import HeroBanner from '../components/HeroBanner'
import SearchExercices from '../components/SearchExercices'
import Exercices from '../components/Exercices'
import { exGetOptions , fetchData } from '../utils/fetchData'

const Home = () => {

    const [exercices , setExercices] = useState([])
    const [bodyPart , setBodyPart] = useState('all')
    const [noExercisesFound , setNoExercisesFound] = useState(false)

    return (
        <Box>
            <HeroBanner />
            <SearchExercices  setExercices={setExercices} bodyPart={bodyPart} setBodyPart={setBodyPart}/>
            <Exercices  noExercisesFound setExercices={setExercices} bodyPart={bodyPart} exercices={exercices}/>

        </Box>
    )
}
export default Home
